.commentContainer{
  background: #fff;
  padding: 10px;
  box-sizing: border-box;
  height: 407px;
  max-height: 407px;
  overflow: hidden;
  border-radius: 6px;
  justify-content: space-between;
  .comment{
      border-bottom: 1px solid #e8e8e8;
      padding-bottom: 5px;
     .left{
        width:80px;
        text-align: center;
        .userImg{
          width:50px;
          border-radius: 50%;
        }
     }
     .right{
          justify-content: space-between;
          height: 120px;
         .username{
           font-size: 14px;
           font-weight: bold;
         }
         .content{
           font-size: 13px;
           line-height: 20px;
         }
         .dateTime{
            text-align: right;
            font-size: 13px;
            color:#87DE75;
            .svg-icon{
              margin-right: 5px;
            }
         }

     }
  }
}
